package variablesanddatatype;

public class SecondVariableClaa {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        // Arithmetic Operators
		int a=10;
		int b=20;
		// +,-,*,/,%
		System.out.println(a+b);
		System.out.println(a-b);
		System.out.println(a*b);
		System.out.println(a/b);
		System.out.println(a%b);
	}

}
